// src/data/products.js
import bus from "../Images/3d brick.jpg"
const Products = [
    { id: 1, title: "Mandala Planter White Pearl", price: 51, category: 'Planter', description: 'White', image: {bus}, rating: { rate: 4.5 }, },
    { id: 2, title: 'Mandala Stool Brown Wood', price: 544, category: 'Furniture', description: 'Brown', image: 'path/to/brown-stool.jpg', rating: { rate: 4.0 }, },
    { id: 3, title: 'Mandala Planters Clear', price: 51, category: 'Planter', description: 'Clear', image: 'path/to/clear-planter.jpg', rating: { rate: 4.2 }, },
  ];
  
  export default Products;
